			align-items: center;

			justify-content: center;
			align-items: center;
			height: 50%;
			width: 100%;
			flex-direction: column;

		}

		.rotate-text {
			width: 60%;

		.rotate-icon img:first-child {

			z-index: 2;

			animation: rotate-icon 3s infinite;
			opacity: 0.5;
			max-width: 100%;
			max-height: 100%;

			/* left: 17px; */

			right: 0;

			margin: auto;

	<script>function customPreloaderInit() {
			let data = window.editorParams;

			if (!data) {
				requestAnimationFrame(customPreloaderInit);
				return;
			}

			if (!data.preloaderEnabled) {
				return;
			}
			var circleInner = document.getElementById("loading-circle-inner");
			var progress = 0;

			window.customPreloaderProgress = 0;

			var updatePreloader = () => {
				if (progress >= 100) {
					window.customPreloaderProgress = 100;
					return;
				}
				requestAnimationFrame(updatePreloader);

				var fillColor = data.preloaderBarFillColor || "#008be8";
				var bgColor = data.preloaderBarBgColor || "#000000";
				progress += 0.5;
				progress = Math.min(progress, 100);
				var value = progress * 3.6;

				window.customPreloaderProgress = progress;

				if (progress > 50) {
					value = value - 180;

					circleInner.style.backgroundImage = `linear-gradient(${value}deg, transparent 50%, ${fillColor} 50%), linear-gradient(0deg, ${bgColor} 50%, transparent 50%)`;
				} else {
					circleInner.style.backgroundImage = `linear-gradient(${value}deg, transparent 50%, ${bgColor} 50%), linear-gradient(0deg, ${bgColor} 50%, transparent 50%)`;
				}
			};
			updatePreloader();
		}
		setTimeout(() => {
			customPreloaderInit();
		}, 1);</script>
